import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the notifications button to open the notifications modal
    await page.waitForSelector('#notificationsBtn');
    await page.click('#notificationsBtn');
    await page.waitForLoadState('networkidle');

    // Wait for notification time elements to load
    await page.waitForSelector('.notification-time');

    // Extract notification time information
    const notificationTimes = await page.$$eval('.notification-time', elements => {
      return elements.map(el => el.textContent.trim());
    });

    // Convert time information to timestamps
    const timestamps = notificationTimes.map(time => {
      const date = new Date();
      // Assuming the time format is relative (e.g., "2 hours ago")
      const timeParts = time.split(' ');
      if (timeParts[1] === 'hours') {
        date.setHours(date.getHours() - parseInt(timeParts[0]));
      } else if (timeParts[1] === 'minutes') {
        date.setMinutes(date.getMinutes() - parseInt(timeParts[0]));
      } else if (timeParts[1] === 'seconds') {
        date.setSeconds(date.getSeconds() - parseInt(timeParts[0]));
      }
      return date.getTime();
    });

    // Take a screenshot of the notifications modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications_modal.png'));

    return {
      success: true,
      action: "Collected notification time information and converted to timestamps",
      extractedData: { timestamps },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

