    await page.waitForSelector('.notification-modal'); // Adjust based on actual modal selector

    // Wait for the notification times to load
    await page.waitForSelector('.notification-time'); // Adjust based on the actual selector for notification times

    // Extract time information from all notification elements
    const notificationTimes = await page.$$eval('.notification-time', elements => 
      elements.map(element => element.textContent.trim())
    );

    // Convert notification times to timestamps
